  let [products, setProduct] = useState([])

  useEffect(() => {
    getProduct()
  }, []);



  let getProduct = async() => {

    let response = await fetch("http://localhost:8000/apis/products/")
    let data = await response.json()
    setProduct(data)

  }



  return (
    <div>

      { products.map((product, index ) => {
        <h1> { product.name } </h1>
      })}

    </div>

  );
}

export default ProductCard;
